import React from "react";
import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta avatar={<Avatar>Withg</Avatar>} />
    </Card>
  );
};

export default UserProfile;
